import Homepage from "./Layout/Homepage";
import LoginPage from "./Layout/loginPage";
import NewsFeedPage from "./Layout/NewsFeedPage";
import SignupPage from "./Layout/signupPage";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import CategoryPage from "./Layout/CategoryPage";
import checkAuth from "./Components/Login/checkAuth";
import Query from "./Components/Query/Query";
import ArticlePage from "./Layout/ArticlePage";
import { NewsContext } from "./Components/News";

function App() {
  return (
    <>
      <NewsContext>
        <BrowserRouter>
          <Routes>
            <Route exact path="/login" element={<LoginPage />} />
            <Route path="/signup" element={<SignupPage />} />
            <Route path="/" element={<Homepage />} />
            <Route path="/newsfeed" element={<NewsFeedPage />} />
            <Route path="/category/:categoryName" element={<CategoryPage />} />
            <Route path="/query/:queryName" element={<Query />} />
            <Route path="/article" element={<ArticlePage />} />
          </Routes>
        </BrowserRouter>
      </NewsContext>
    </>
  );
}

export default App;
